import React, { Component } from 'react'
import MyNavLink from "../MyNavLink"
import './index.css'
export default class Header extends Component {
  render() {
    const { pages } = this.props
    return (
      <div className="header">
        <MyNavLink className={pages===1?'active':''} to="/editArticle">编辑</MyNavLink>
        <MyNavLink className={pages===2?'active':''} to="/articleOnlineList">浏览</MyNavLink>
      </div>
    )
  }
}
